const CONNEXION_STATUS= {
    connected:dada
}
function connexionReducer (state = CONNEXION_STATUS, action ){
    switch(action.type)
    {
        case'CONNECTED':
        return{
            ...state,
            connected:true
        };
        case 'DISCONNECTED':
        return{
            ...state,
            connected:false
        };

        default:
        return state;

    }
}
export default connexionReducer
